import classes from "./DetailOrder.module.css";
//----------------------------------------------------------
function DetailOrder() {
  if (data.length === 0) return <h2 className={classes.message}>No History</h2>;
  return (
    <div className={classes.container}>
      <table cellSpacing={0}>
        <thead>
          <tr>
            <th>ID ORDER</th>
            <th>ID USER</th>
            <th>NAME</th>
            <th>PHONE</th>
            <th>ADDRESS</th>
            <th>TOTAL</th>
            <th>STATUS</th>
            <th>DETAIL</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>446</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
//---------------------------------------------------
export default DetailOrder;
